import { AppBar, Toolbar, Typography, Button } from "@material-ui/core";

const NavBar = () => {
  return (
    <>
      <AppBar>
        <Toolbar>
          <Typography variant="h6 ">Sunny</Typography>
          <Button></Button>
        </Toolbar>
      </AppBar>
    </>
  );
};
export default NavBar;
